import './App.css';
import Dashboard from "./Dashboard";
import {createMuiTheme} from "@material-ui/core";
import {ThemeProvider} from '@material-ui/core/styles';
import {lime, teal, } from "@material-ui/core/colors";

function App() {
  const theme = createMuiTheme({
    overrides: {
      MuiTablePagination: {
        spacer: {
          flex: 'none'
        }
      }
    },
    palette: {
      type: "dark",
      primary: lime,
      secondary: {
        main: '#2c89b2',
      },
    },
  });

  return (
    <Dashboard />
  );
}

export default App;
